import * as React from "react";

type Cell = 1 | 2 | null;

export type CellProps = {
  onClick: () => void;
  cell: Cell;
};

const Cell: React.FC<CellProps> = cellProps => {
  return (
    <td className="cell" onClick={cellProps.onClick}>
      {cellProps.owner === 1 ? "X" : cellProps.owner === 2 ? "O" : " "}
    </td>
  );
};

export default Cell;
